function Cart({ user }) {
  const listUserItems = user.items.map((item) => (
    // <ul key={item.id}>
    //   <li key={item.name}>{item.name}</li>
    // </ul>
    <h1 key={item.id}>
      {item.name} - ${item.price}
    </h1>
  ));

  let sum = user.items.reduce(function (prev, current) {
    return prev + +current.price;
  }, 0);
  console.log(sum);

  return (
    <div>
      <h1>{user.username}'s Cart</h1>
      {listUserItems}
      {user.total}
    </div>
  );
}
export default Cart;
